import React, { Component } from "react";
import Link from "next/link";

class Layout extends Component {
  state = {};
  render() {
    return (
      <div
        style={{
          fontFamily: "Courier, Courier New, monospace",
        }}
      >
        <container>
          <Link href="/" as={`/`}>
            <button className="absolute top-0 left-0 m-4 px-3 bg-gray-400 opacity-50 hover:opacity-75 rounded-full border-black border">
              back
            </button>
          </Link>

          <img
            src={`/img/projectPictures/${this.props.projectImgPath}/landing.png`}
            alt="landing page"
          />
          <p>{this.props.projectName}</p>
          <p>{this.props.projectYear}</p>
        </container>
        <div className="container">
          <div>{this.props.children}</div>
        </div>
      </div>
    );
  }
}

export default Layout;
